  }


  @Test
  def testChiSquaredScalled(): Unit = {
    val d = TimeSeriesData.data.toList
    val d2 = d.map(x => (x-d.min) / (d.max- d.min))
    val test = new ChiSquaredCheck().getDistribution(d2.toArray)


    println(d2.mkString(", "))
    println(test)

//    assertEquals(Beta(2.0,5.0), test)
  }

  @Test
  def testChiSquaredRandomized(): Unit = {
    val rnd = new Random()
    val  d = TimeSeriesData.data.toList
    val d2 = d.map(x => ((x-d.min) / (d.max- d.min) + rnd.nextDouble()/10.0)) ++ List(0.0, 1.0) //to have proper borders
    val test = new ChiSquaredCheck().getDistribution(d2.toArray)


    println(d2.mkString(", "))
    println(test)

//    assertEquals(Beta(2.0,5.0), test)
  }



